```{.r .cell-code}
library(reactable)
library(arrow)
library(dplyr)
library(tidyr)
library(purrr)
library(htmltools)

combine_player_details <- read_parquet("https://github.com/bit-in-that/data-automation/raw/main/players/data/processed/combine_player_details.parquet")

